import React from "react";
import { Container, Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
   <Menu fixed='top' inverted>
     <Container>
     <Menu.Item header>
      <img src="/assets/logo.png" alt="Logo" style={{width:'100px'}}/>
     </Menu.Item>
     </Container>

   </Menu>
  );
};
